import {BrowserRouter, Route} from 'react-router-dom'
import TambahkanPenyakit from './TambahkanPenyakit';
import TesDNA from './TesDNA';

class Menu extends React.Component {
    render() {
        return (
            <BrowserRouter>
                {/*<div className = {styles.menu}>
