                        <button onClick='' className={styles.klik}>Tes DNA</button>
                    </div>
                    <div className={styles.opsi}>
                        <button onClick='' className={styles.klik}>Pencarian</button>
                    </div>
                </div>*/}
                <Fragment>
                    <Route path='/tambahkanpenyakit' component={TambahkanPenyakit}></Route>
                    <Route path='/tesdna' component={TesDNA}></Route>
                </Fragment>
            </BrowserRouter>
        )
    }
}

export default Menu;
